import logo from './max.jpg';
import './App.css';
import React, { useState } from 'react';
import UofTResources from './UofTResources';

function App() {
  const [animateProjects, setAnimateProjects] = useState(false);
  const [animateHome, setAnimateHome] = useState(false);

  const handleProjectsClick = () => {
    setAnimateHome(true);
    setAnimateProjects(true);
    setTimeout(() => {
      setAnimateHome(false);
      console.log("Animation completed.");
    }, 500);
  };

  const handleHomeClick = () => {
    setAnimateHome(true);
    setAnimateProjects(false);
    setTimeout(() => {
      console.log("Animation completed.");
    }, 500);
  };

  return (
    <div className="App">
      <nav className="App-nav">
        <a href="#home" onClick={handleHomeClick} className={`nav-item ${animateHome ? 'slide-out-right' : ''}`}>Home</a>
        <a href="#projects" onClick={handleProjectsClick} className={`nav-item ${animateProjects ? 'slide-in-left' : ''}`}>TODO: Projects</a>
        <a href="#resources" className="nav-item">UofT Resources</a>
        <a href="https://www.overleaf.com/read/xyvycpwfxnxj" target="_blank" rel="noopener noreferrer" className="nav-item">Resume</a>
      </nav>

      <div className={`content ${animateProjects ? 'slide-in-left' : animateHome ? 'slide-out-left' : ''}`}>
        <Home />
      </div>
    </div>
  );
}

function Home() {
  return (
    <header className="App-header">
      <img src={logo} className="App-logo" alt="logo" />
      <p>
        Edit <code>src/App.js</code> and save to reload.
      </p>
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>
    </header>
  );
}

function Projects() {
  return (
    <div className="projects">
      {/* Contents of the Projects section */}
      <h1>Projects</h1>
      <p>This is the Projects section.</p>
    </div>
  );
}

export default App;
